import React, { useEffect, useState } from 'react';
import { withBase } from '../api';

// Admin panel to list and manage users (pending, approve, reject)
export default function AdminApprovalPanel() {
  const [users, setUsers] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);
  const [filter, setFilter] = useState('pending');

  const load = () => {
    setLoading(true); setError(null);
    fetch(withBase(`/api/admin/users?status=${filter}`), { credentials: 'include' })
      .then(r => r.ok ? r.json() : Promise.reject(r))
      .then(setUsers)
      .catch(e => setError('Nuk u lexua lista'))
      .finally(()=> setLoading(false));
  };

  useEffect(() => { load(); }, [filter]);

  const approve = (id) => {
    fetch(withBase(`/api/admin/users/${id}/approve`), { method:'POST', credentials:'include' })
      .then(r => r.ok ? r.json() : Promise.reject(r))
      .then(()=> load())
      .catch(()=> setError('Gabim gjatë aprovimit'));
  };
  const rejectUser = (id) => {
    fetch(withBase(`/api/admin/users/${id}/reject`), { method:'POST', credentials:'include' })
      .then(r => r.ok ? r.json() : Promise.reject(r))
      .then(()=> load())
      .catch(()=> setError('Gabim gjatë refuzimit'));
  };

  return (
    <div style={{padding:'1rem'}}>
      <h3>Menaxhimi i Përdoruesve</h3>
      <div style={{display:'flex', gap:'0.5rem', marginBottom:'0.75rem'}}>
        {['pending','approved','rejected','all'].map(f => (
          <button key={f} disabled={filter===f} onClick={()=>setFilter(f)}>{f}</button>
        ))}
      </div>
      {loading && <p>Duke lexuar...</p>}
      {error && <p style={{color:'red'}}>{error}</p>}
      {users.length === 0 && !loading && <p>Asnjë përdorues.</p>}
      <table style={{width:'100%', borderCollapse:'collapse'}}>
        <thead>
          <tr style={{textAlign:'left'}}>
            <th>ID</th><th>Username</th><th>Emri</th><th>Provider</th><th>Status</th><th>Roli</th><th>Krijuar</th><th>Last Login IP</th><th>Veprime</th>
          </tr>
        </thead>
        <tbody>
          {users.map(u => {
            const statusLabel = u.approved === 1 ? 'approved' : (u.approved === 0 ? 'pending' : 'rejected');
            return (
              <tr key={u.id} style={{borderBottom:'1px solid #ddd'}}>
                <td>{u.id}</td>
                <td>{u.username}</td>
                <td>{u.display_name || '-'}</td>
                <td>{u.provider || '-'}</td>
                <td>{statusLabel}</td>
                <td>{u.role}</td>
                <td>{u.created_at || '-'}</td>
                <td>{u.last_login_ip || '-'}</td>
                <td style={{display:'flex', gap:'0.25rem'}}>
                  {u.approved === 0 && <button onClick={()=>approve(u.id)}>Aprovo</button>}
                  {u.approved === 0 && <button onClick={()=>rejectUser(u.id)}>Refuzo</button>}
                </td>
              </tr>
            );
          })}
        </tbody>
      </table>
      <div style={{marginTop:'0.5rem'}}>
        <button onClick={load} disabled={loading}>Rifresko</button>
      </div>
    </div>
  );
}
